import React, { Component } from "react";

class images extends Component {
    render() {
        return (
            <img 
                src="https://s3-ap-southeast-1.amazonaws.com/niomic/img/sample/food1.jpg" 
                width="200" height='100' alt="food1"/>
        );
    }
}

export default ImageComponent;
